import {useParams} from "react-router-dom";
import {useEffect} from "react";
import {loadImages} from "../../../integrations/image-loader";

export function Detail() {
    const {id, challenge} = useParams();
    const [images, setImages] = useState({})

    useEffect(() => {
        const start = async () => {
            const c = await loadImages(id, challenge)
            setImages(c)
        }
        start()
    })

    return (
        <div className={"flex flex-column"}>Detail - {challenge}</div>
    )
}
